1. Scope of application
(a) When you register this application account, you provide personal registration information according to the application requirements;
(b) When you use the application network services or visit the web pages of the application platform, the application automatically receives and records the information on your browser and computer, including but not limited to your IP address, the type of browser, the language used, the date and time of access, software and hardware features and the web page records you need;
(c) User personal data obtained by the application from business partners through legal channels.
You understand and agree that the following information does not apply to this privacy policy:
(a) The keyword information you enter when using the search service provided by this application platform;
(b) The relevant information and data collected by this application, including but not limited to participatory activities, transaction information and evaluation details, are published by you in this application;
(c) Violation of the law or the applicable rules and the measures taken by the application to you.

